        playSound();
        isPlaying = true;document.getElementById("play_button").style.display="none";
    }
    else {
        pauseSound();
        window.currentTime = myAudioContext.currentTime
        myAudioContext.suspend();
        isPlaying = false;
    }
}
function drawSpectrum() {
    window.time_array = new Uint8Array(myAudioAnalyser.frequencyBinCount);
    window.freq_array = new Uint8Array(myAudioAnalyser.frequencyBinCount);
    myAudioAnalyser.getByteTimeDomainData(window.time_array);
myAudioAnalyser.getByteFrequencyData(window.freq_array);
